Galima skambinti ir savaitgaliais!
MALONIAI KVIEČIAME APSILANKYTI! Visus naujausius CAPITAL nekilnojamojo turto skelbimus rasite mūsų internetiniame puslapyje www.capital.lt. Kviečiame apsilankyti!

Tai namai, į kuriuos grįžę lengvai pamiršite dienos rūpesčius, gamtos apsuptyje, atokiau nuo miesto šurmulio neišvengiamai panirsite į ramybę ir atsipalaidavimą. Jaukioje terasoje ištisus metus galėsite stebėti besikeičiančius gamtos vaizdus, mėgautis tyru oru vaikštinėjant pušyno alėjomis ar palydėti saulę susiliejančiame jūros ir dangaus horizonte. 

Būstas buvo projektuojamas ir įrengtas sau: didelis dėmesys buvo skirtas stilistikos vientisumui, natūralios šviesos srautui, kokybei, grožiui, bei estetikai, tačiau nepamirštas ir funkcinis patogumas. Namai jaukūs, erdvūs, juose dar niekas negyveno. Dideli, vitrininiai langai. 

Name per tris aukštus suplanuoti 3 miegamieji, erdvi svetainės ir virtuvės zona, drabužinė, 2 wc kambariai, rytinės saulės nutvieksta medinė terasa. Jūsų patogumui rasite skalbimo mašiną, kavos aparatą, televizorių.

Tobula vieta gyvenimui mėgstantiems aktyvų gyvenimo būdą: dviračių bei pasivaikščiojimo takai vedantys tiek į Palangą tiek į miesto centrą. Beveik ranka pasiekiama jūra rytiniam bėgimui pakrante ar grūdinančioms maudynėms jūroje.

NUOMOS KAINA 1300 EUR/MĖN (tik ilgalaikė nuoma).

