Nuomuojamas jaukus, pilnai įrengtas 165 kv.m namas Trakų r. , 30 km nuo Vilniaus centro. Namas rąstinis, 2 aukštų, pilnai įrengtas, su visais baldais, bei buitine technika, židiniu, pirtimi, didele medine terasa, nuo kurios atsiveria puikus vaizdas į nuosavą tvenkinį, garažu ir malkine. Pirmame aukšte erdvi ir šviesi svetainė su virtuve ir valgomojo zona, vitrininiais langais, pro kuriuos atsiveria vaizdas į vandens tvenkinį, židinys, poilsio kambarys, pirtis su priešpirčiu, wc, dušas, katilinė. Šildomos grindys. Antrame aukšte 3 miegamieji kambariai, drabužinė, skaitymo zona, vonios patalpa. Interjere vyrauja šviesios spalvos ir mediena. Buvo įrengta su meile, asmeniniam naudojimui, todėl viskas kokybiška ir apgalvota. Sumontuota 33 kW saulės elektrinė (8000 kWh už Valstybės nustatytą pasaugojimo mokestį, šiuo metu 7ct/kWh), teritorijos stebėjimo kameros, vartų ir signalizacijos valdymas mobiliąja programėle per nuotolį. Viso sklypo plotas yra 1,5 ha, jame 3 individualūs gyvenamieji namai, garažas, pavėsinė, vaikų žaidimo aikštelė ir šiltnamis. Sklype nuosavas 20 arų skaidrus vandens tvenkinys. Teritorija aptverta tvora, šalia miškas. Asfaltuotas privažiavimas beveik iki pat sklypo(tvarkingo žvyrkelio 400 m.). Šiuose namuose ir žiemą, ir vasarą tvyro ypatingas jaukumo, ramybės ir poilsio jausmas. Būstas pasižymi gera lokacija, nuo Vilniaus miesto centro tik 30km ir atsiduri visiškoje ramybės ir gamtos oazėje. Idealiai tinka žmonėms, vertinantiems nedideles bendruomenes, draugišką kaimynystę, gamtą, ramybę, vandenį. Pritaikyta ir vaikams. Kieme yra įrengta didelė vaikų žaidimų aikštelė su smėlyne, supynėmis. Trinkelėmis grįstas kiemo keliukas puikiai pavirsta dviratukų, paspirtukų ir kitų transporto priemonių trasa. Vasarą, kieme esantis tvenkinys, virsta puikiu paplūdimiu, o žiemą - ledo čiuožykla. Taip pat yra didelis šiltnamis. BE TARPININKŲ.

