Minkšta beribė pieva, raibstantys žiedynai, o vos perėjus savo kiemą – ramiai srūvanti Neris, į kurią žvelgti galima, berods, amžinybę. Skamba kaip nerūpestingos vaikystės atostogų idilė... O galbūt tai gali tapti Jūsų namų aplinka?

Tik 25 minutės nuo Vilniaus centro ir Jūs jau čia – gamtos apsuptyje, o vos atvykę ir įkvėpę saule nuglostytos gamtos suprasite, kad tai – šeimos svajonių būstas. Nestandartiškai aukštų lubų šviesos kupinas 278 kv.m individualus namas, kurtas su meile, pasižymintis itin apgalvotu suplanavimu ir įsigilinimu, kad kiekviena detalė ar kampelis tarnautų tik Jūsų poreikiams ir patogumui. Per 2 aukštus patogiai išsidėsčiusios didelės 5 kambarių erdvės, 4 tylūs miegamieji kiekvienam šių namų gyventojui, 3 vonios kambariai. Namų akcentas – svetainė, pro kurios langus atsiveriantys milijono verti žaliuojantys peizažai puoš Jūsų namus lyg gražiausi paveikslai. Čia rusena židinys, aplink kurį susisėdę praleisite prasmingiausią laiką su artimaisiais.

Visaverčiam atsipalaidavimui po dienos darbų namuose įrengta pirtis ir šildomas baseinas, o iš čia pateksite į erdvią terasą, kurioje saulės spinduliai lepins visą dieną. Žaidimų vakarai, griliaus popietė su kaimynais ar tiesiog rytas su knyga – visa tai net 25 a išpuoselėtame sklype su vaikų pramogų zona, besiribojančiame su Neries krantine.

Tai vieta, kurioje gera gyventi ir kurti naują istoriją – šeimos nariams čia nepritrūks bendravimo, privatumo, erdvios poilsio zonos kvies susitikti, leisti jaukius vakarus kartu, o esant poreikiui atsiskirti - kiekvienas čia atras savo asmeninį kampelį.

Tai namas su laikui nepavaldžiomis technologijomis ir sprendimais: geoterminis šildymas, rekuperacija bei saulės kolektoriai, garažas ir pagalbinės patalpos – tai keli iš patogaus gyvenimo šiame būste kriterijų.

